export const phaseData = [
    {
        "phaseNumber":"Phase 1A",
        "groups":[
            {
                "group":"Quarantine and Border Workers"
            },
            {
                "group":"Frontline health care worker sub-groups for prioritisation"
            },
            {
                "group":"Aged care and disability care staff"
            }
        ]
    },
    {
        "phaseNumber":"Phase 1B",
        "groups":[
            {
                "group":"Healthcare workers currently employed and not included in Phase 1a"
            },
            {
                "group":"Household contacts of quarantine and border workersHousehold contacts of quarantine and border workers"
            },
            {
                "group":"Elderly people aged 80 years and over"
            },
            {
                "group":"Elderly people aged 70 years and over"
            },
            {
                "group":"Aboriginal and Torres Strait Islander people aged 55 years and over"
            },
            {
                "group":"Adults with an underlying medical condition or significant disability"
            }
        ]
    },
    {
        "phaseNumber":"Phase 2A",
        "groups":[
            {
                "group":"Adults aged 60-69 years"
            },
            {
                "group":"Adults aged 50-59 years"
            },
            {
                "group":"Continue vaccinating Aboriginal and Torres Strait Islander adults"
            },
            {
                "group":"Other critical and high risk workers"
            }
        ]
    },
    {
        "phaseNumber":"Phase 2B",
        "groups":[
            {
                "group":"Balance of adult population"
            },
            {
                "group":"Catch up any unvaccinated Australians from previous phases"

            }
        ]
    },
    {
        "phaseNumber":"Phase 3",
        "groups":[
            {
                "group":"< 16 if recommended"
            }
        ]
    }
]
